-- set Employee Types
-- set department heads
update Employee set EmployeeTypeID=3 where EmployeeID between 1 and 5;
-- set direct supervisors
update Employee set EmployeeTypeID=2 where EmployeeID between 6 and 25;
-- set bencos
update Employee set EmployeeTypeID=4 where EmployeeID between 26 and 50;
-- set normal employees
update Employee set EmployeeTypeID=1 where EmployeeID between 51 and 150;

-- set supervisors
update Employee
	 set DirectSupervisorID=6
 where EmployeeID between 51 and 75;
update Employee
	 set DirectSupervisorID=7
 where EmployeeID between 76 and 100;
update Employee
	 set DirectSupervisorID=8
 where EmployeeID between 101 and 115;
update Employee
	 set DirectSupervisorID=9
 where EmployeeID between 116 and 130;
update Employee
	 set DirectSupervisorID=10
 where EmployeeID between 131 and 150;

update Employee
	 set DepartmentID=1
 where EmployeeID=1;
update Employee
	 set DepartmentID=2
 where EmployeeID=2;
update Employee
	 set DepartmentID=3
 where EmployeeID=3;
update Employee
	 set DepartmentID=4
 where EmployeeID=4;
update Employee
	 set DepartmentID=5
 where EmployeeID=5;

-- set department heads
update Employee
	 set DepartmentID=1
 where EmployeeID=6  OR EmployeeID=7 OR EmployeeID between 51 and 100;

update Employee
	 set DepartmentID=2
 where EmployeeID=8  OR EmployeeID=9 OR EmployeeID between 101 and 150;
